.property-wrapper{
  padding: 15px;
  height: 100%;
  min-height: 705px;
  background-color: #F2F5FF;
  box-sizing: border-box;
}

.property-wrapper .el-row:nth-child(1){
  height: 280px;
  margin-bottom: 15px;
}

.property-wrapper .el-row:nth-child(2){
  height: 380px;
}

.property-wrapper .el-col{
  height: 100%;
  border-radius: 4px;
  overflow: hidden;
}

.property-template{
  width: 100%;
  height: 100%;
  padding: 15px;
  background-color: #ffffff;
}

.template-height{
  height: 380px;
}

.property-table{
  margin-top: 15px;
}
